                        <li>Georgia Brooks University is the highest ranked university in the world. We offer Undergraduate, Masters and Doctoral degrees in Computer Science, Business, Accounting, Culinary Studies and the Arts. However, our Computer Science program is the top Computer Science curriculum in the world.</li>
